        var browser: String? = null
        var count = 0.0
        for (freq in freqMap.entries) {
            count += freq.value
            if (rand <= count) {
                browser = freq.key
                break
            }
        }

        if (browser == null) {
            browser = "Chrome"
        }

        val userAgents = uaMap[browser]?: arrayOf("")
        return userAgents[floor(Math.random() * userAgents.size).toInt()]
    }
}